import React from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import useMediaQuery from '@material-ui/core/useMediaQuery';

function MyComponent() {


  return <Dialog fullScreen={fullScreen} />
}

export default function FormDialog() {
  const [open, setOpen] = React.useState(false);
  const theme = useTheme();
  const fullScreen = useMediaQuery(theme.breakpoints.down('sm'));

  function handleClickOpen() {
    setOpen(true);
  }

  function handleClose() {
    setOpen(false);
  }

  function handleRegisterClose() {
    // TODO: check if inputs entered
    // setOpen(false);
    // open another dialog box of confirmation 
  }

  return (

    <div>
      <Button variant="outlined" color="primary" onClick={handleClickOpen}>
        Open form dialog
      </Button>
      <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title" fullScreen={fullScreen}>
        <DialogTitle id="form-dialog-title">Register</DialogTitle>
        <DialogContent>
          <DialogContentText>
            You have chosen to have the free trial class on ________ . Enter the information below to complete registration. 
          </DialogContentText>
          <TextField
            // autoFocus = "false"
            margin="normal"
            id="email"
            label="Email Address"
            type="email"
            required
            fullWidth
          />
          <TextField
            // autoFocus="false"
            margin="normal"
            id="name"
            label="Name(s) of participant(s)"
            type="text"
            required
            fullWidth
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Cancel
          </Button>
          <Button onClick={handleRegisterClose()} color="primary">
            Register
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
